import Header from './components/Header'
import Banner from './components/Banner'
import Content from './components/Content'
import CTA from './components/CallToAction'
import Footer from './components/Footer'
import './App.css'

function App() {
  return (
    <>
      <Header />
      <Banner />
      <Content />
      <CTA />
      <Footer />
    </>
  );
}

export default App;
